import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  background-color: white;
  padding-top: 23px;
`;

const TrHead = styled.div`
  width: 1072px;
  height: 54px;
  padding: 16px 60px 16px 32px;
  border-radius: 3px;
  background-color: #fafafa;
`;

const ThContainer = styled.div`
  margin: 0 30px;
`;

const table = [
  { title: "Date/Time" },
  { title: "Name" },
  { title: "Device" },
  { title: "Payment" },
  { title: "BIN Number" },
  { title: "Amount" },
  { title: "Trans ID" },
  { title: "Decision" },
];
const TransactionLog = () => {
  return (
    <Container>
      <TrHead>
        <tr>
          <ThContainer>
            <th>Date/Time</th>
          </ThContainer>
          <th>Name</th>
          <th>Device</th>
          <th>Payment</th>
          <th>BIN Number</th>
          <th>Amount</th>
          <th>Trans ID</th>
          <th>Decision</th>
        </tr>
      </TrHead>
      <tr>
        <td>Alfreds Futterkiste</td>
        <td>Maria Anders</td>
        <td>Germany</td>
      </tr>
    </Container>
  );
};

export default TransactionLog;
